import { Link, NavLink } from "react-router-dom";
// import class_navbar from "./Navbar.module.css";
import class_navbar from "./Navbar1.module.css";
// import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className={class_navbar.nav}>
      <div className={class_navbar.item}>
        <Link to="/dialogs" activeClassName={class_navbar.active23}>
          Messanges
        </Link>
      </div>
      <div className={class_navbar.item}>
        <Link to="/profile" activeClassName={class_navbar.active23}>
          Profile
        </Link>
      </div>
      <div className={class_navbar.item}>
        <Link to="/news" activeClassName={class_navbar.active23}>
          News
        </Link>
      </div>
      <div className={class_navbar.item}>
        <Link to="/music" activeClassName={class_navbar.active23}>
          Music
        </Link>
      </div>
      <div className={class_navbar.item}>
        <Link to="/settings" activeClassName={class_navbar.active23}>
          Settings
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
